contracts/AccessControlExample.sol.content:
// SPDX-License-Identifier: BSD-3-Clause-Clear
pragma solidity ^0.8.24;

/**
 * @title Access Control Example for FHE
 * @notice Demonstrates FHE.allow and FHE.allowThis patterns
 * @dev Shows how to manage permissions on encrypted data
 *
 * Key Concepts:
 * - FHE.allow(value, address) - Grant address permission to decrypt value
 * - FHE.allowThis(value) - Grant contract permission to use value
 * - FHE.allowTransient(value, address) - Temporary permission (single transaction)
 * - Permission management best practices
 */
contract AccessControlExample {
  /// @notice Stores encrypted balance for each user
  mapping(address => bytes32) private _encryptedBalances;

  /// @notice Stores permissions: user => value => allowed addresses
  mapping(address => mapping(bytes32 => mapping(address => bool))) private _permissions;

  /// @notice Contract owner
  address public owner;

  event BalanceSet(address indexed user, bytes32 encryptedValue);
  event PermissionGranted(address indexed owner, bytes32 indexed value, address indexed grantee);
  event PermissionRevoked(address indexed owner, bytes32 indexed value, address indexed grantee);

  modifier onlyOwner() {
    require(msg.sender == owner, "Only owner");
    _;
  }

  constructor() {
    owner = msg.sender;
  }

  /**
   * @notice Set encrypted balance for user
   * @param _encryptedBalance The encrypted balance value
   * @dev Demonstrates FHE.allowThis pattern - contract needs permission to store value
   */
  function setBalance(bytes32 _encryptedBalance) external {
    // In real FHEVM: FHE.allowThis(_encryptedBalance)
    // This allows contract to store and use the encrypted value

    _encryptedBalances[msg.sender] = _encryptedBalance;

    // Automatically grant permission to the user
    _permissions[msg.sender][_encryptedBalance][msg.sender] = true;

    emit BalanceSet(msg.sender, _encryptedBalance);
  }

  /**
   * @notice Grant permission to another address to view encrypted balance
   * @param _recipient Address to grant permission to
   * @dev Demonstrates FHE.allow pattern - sharing encrypted data
   */
  function grantAccess(address _recipient) external {
    require(_recipient != address(0), "Invalid recipient");
    require(_encryptedBalances[msg.sender] != bytes32(0), "No balance set");

    bytes32 userBalance = _encryptedBalances[msg.sender];

    // In real FHEVM: FHE.allow(userBalance, _recipient)
    // This grants _recipient permission to decrypt the value

    _permissions[msg.sender][userBalance][_recipient] = true;

    emit PermissionGranted(msg.sender, userBalance, _recipient);
  }

  /**
   * @notice Revoke permission from an address
   * @param _recipient Address to revoke permission from
   * @dev Important: FHE permissions are typically not revocable, this is simulated
   */
  function revokeAccess(address _recipient) external {
    require(_encryptedBalances[msg.sender] != bytes32(0), "No balance set");

    bytes32 userBalance = _encryptedBalances[msg.sender];
    _permissions[msg.sender][userBalance][_recipient] = false;

    emit PermissionRevoked(msg.sender, userBalance, _recipient);
  }

  /**
   * @notice Get user's encrypted balance
   * @param _user Address of user
   * @return The encrypted balance (if caller has permission)
   * @dev Checks permission before returning encrypted value
   */
  function getBalance(address _user) external view returns (bytes32) {
    bytes32 balance = _encryptedBalances[_user];
    require(balance != bytes32(0), "No balance found");

    // Check if caller has permission
    require(
      _permissions[_user][balance][msg.sender] ||
      msg.sender == _user ||
      msg.sender == owner,
      "Access denied"
    );

    return balance;
  }

  /**
   * @notice Check if address has permission to access encrypted value
   * @param _owner Owner of the encrypted value
   * @param _accessor Address to check permission for
   * @return True if accessor has permission
   */
  function hasPermission(address _owner, address _accessor) external view returns (bool) {
    bytes32 balance = _encryptedBalances[_owner];
    if (balance == bytes32(0)) return false;

    return _permissions[_owner][balance][_accessor] ||
           _accessor == _owner ||
           _accessor == owner;
  }

  /**
   * @notice Demonstrates batch permission granting
   * @param _recipients Array of addresses to grant permission to
   * @dev Efficient way to grant multiple permissions
   */
  function batchGrantAccess(address[] calldata _recipients) external {
    require(_encryptedBalances[msg.sender] != bytes32(0), "No balance set");
    bytes32 userBalance = _encryptedBalances[msg.sender];

    for (uint256 i = 0; i < _recipients.length; i++) {
      require(_recipients[i] != address(0), "Invalid recipient");

      // In real FHEVM: FHE.allow(userBalance, _recipients[i])
      _permissions[msg.sender][userBalance][_recipients[i]] = true;

      emit PermissionGranted(msg.sender, userBalance, _recipients[i]);
    }
  }

  /**
   * @notice Simulate transient permission (single-use)
   * @param _recipient Address to grant temporary permission
   * @dev In real FHEVM: FHE.allowTransient provides one-time access
   */
  function grantTransientAccess(address _recipient) external {
    require(_recipient != address(0), "Invalid recipient");
    require(_encryptedBalances[msg.sender] != bytes32(0), "No balance set");

    bytes32 userBalance = _encryptedBalances[msg.sender];

    // In real FHEVM: FHE.allowTransient(userBalance, _recipient)
    // This grants temporary permission that expires after current transaction

    // Simulated: immediate permission grant/revoke pattern
    _permissions[msg.sender][userBalance][_recipient] = true;

    emit PermissionGranted(msg.sender, userBalance, _recipient);
  }

  /**
   * @notice Transfer encrypted balance to another user
   * @param _to Recipient address
   * @param _encryptedAmount Encrypted amount to transfer
   * @dev Demonstrates permission requirements for operations on encrypted values
   */
  function transfer(address _to, bytes32 _encryptedAmount) external {
    require(_to != address(0), "Invalid recipient");
    require(_encryptedBalances[msg.sender] != bytes32(0), "No balance");

    // In real FHEVM:
    // 1. FHE.allowThis(_encryptedAmount) - contract needs permission
    // 2. Perform FHE.sub on sender balance
    // 3. Perform FHE.add on recipient balance
    // 4. FHE.allow(newSenderBalance, msg.sender)
    // 5. FHE.allow(newRecipientBalance, _to)

    // Simulated transfer
    bytes32 newSenderBalance = keccak256(abi.encodePacked(
      _encryptedBalances[msg.sender],
      _encryptedAmount,
      "transfer_out"
    ));

    bytes32 newRecipientBalance = keccak256(abi.encodePacked(
      _encryptedBalances[_to],
      _encryptedAmount,
      "transfer_in"
    ));

    _encryptedBalances[msg.sender] = newSenderBalance;
    _encryptedBalances[_to] = newRecipientBalance;

    // Grant permissions
    _permissions[msg.sender][newSenderBalance][msg.sender] = true;
    _permissions[_to][newRecipientBalance][_to] = true;
  }

  /**
   * @notice Example of INCORRECT permission usage (anti-pattern)
   * @dev This function demonstrates what NOT to do
   */
  function antiPatternNoAllowThis(bytes32 _encryptedValue) external pure returns (bytes32) {
    // ❌ WRONG: Using encrypted value without FHE.allowThis
    // This will fail in real FHEVM
    return keccak256(abi.encodePacked(_encryptedValue, "operation"));
  }

  /**
   * @notice Example of CORRECT permission usage
   * @param _encryptedValue Encrypted value to process
   * @return Result of operation
   */
  function correctPatternWithAllowThis(bytes32 _encryptedValue) external pure returns (bytes32) {
    // ✅ CORRECT: In real FHEVM, you would call FHE.allowThis(_encryptedValue)
    // before performing any operations on the encrypted value

    // FHE.allowThis(_encryptedValue);  // Grants contract permission
    return keccak256(abi.encodePacked(_encryptedValue, "operation"));
  }
}

contracts/AntiPatterns.sol.content:
// SPDX-License-Identifier: BSD-3-Clause-Clear
pragma solidity ^0.8.24;

/**
 * @title FHE Anti-Patterns
 * @notice Demonstrates common mistakes and how to avoid them
 * @dev Educational contract showing what NOT to do with FHE
 *
 * This contract intentionally contains anti-patterns for educational purposes.
 * DO NOT use these patterns in production!
 *
 * Common Mistakes Covered:
 * 1. View functions with encrypted values (not allowed)
 * 2. Missing FHE.allowThis() permissions
 * 3. Incorrect handle lifecycle management
 * 4. Improper access control
 * 5. Gas inefficiencies
 */
contract AntiPatterns {
  bytes32 public encryptedValue;
  mapping(address => bytes32) public userValues;

  /**
   * @notice ANTI-PATTERN #1: View function returning encrypted value for computation
   * @dev ❌ WRONG: Cannot perform FHE operations in view functions
   *
   * Why it's wrong:
   * - View functions cannot modify state or perform FHE operations
   * - FHE operations require transaction context
   * - This will always fail in real FHEVM
   */
  function antiPattern1_ViewFunctionWithEncryption(
    bytes32 _encryptedA,
    bytes32 _encryptedB
  ) external pure returns (bytes32) {
    // ❌ WRONG: Attempting FHE operation in view function
    // In real FHEVM: euint32 result = FHE.add(_encryptedA, _encryptedB);
    // This will FAIL because view functions cannot perform FHE operations
    return keccak256(abi.encodePacked(_encryptedA, _encryptedB));
  }

  /**
   * @notice CORRECT PATTERN: State-changing function for FHE operations
   * @dev ✅ CORRECT: Use regular function, not view
   */
  function correctPattern1_StatefulFHEOperation(
    bytes32 _encryptedA,
    bytes32 _encryptedB
  ) external returns (bytes32) {
    // ✅ CORRECT: FHE operations in state-changing function
    bytes32 result = keccak256(abi.encodePacked(_encryptedA, _encryptedB, "add"));
    encryptedValue = result;
    return result;
  }

  /**
   * @notice ANTI-PATTERN #2: Missing FHE.allowThis() permission
   * @dev ❌ WRONG: Contract needs permission to use encrypted values
   *
   * Why it's wrong:
   * - Contract must be granted permission via FHE.allowThis()
   * - Without permission, cannot perform operations on encrypted data
   * - Will fail with "permission denied" error
   */
  function antiPattern2_MissingAllowThis(bytes32 _encrypted) external {
    // ❌ WRONG: No FHE.allowThis() call
    // In real FHEVM, this will fail:
    // euint32 value = _encrypted;
    // euint32 result = FHE.add(value, FHE.asEuint32(1)); // FAILS!

    encryptedValue = _encrypted; // Will fail in real FHEVM
  }

  /**
   * @notice CORRECT PATTERN: Proper permission management
   * @dev ✅ CORRECT: Always call FHE.allowThis() before operations
   */
  function correctPattern2_WithAllowThis(bytes32 _encrypted) external {
    // ✅ CORRECT: Grant contract permission first
    // In real FHEVM: FHE.allowThis(_encrypted);

    // Now contract can use the encrypted value
    encryptedValue = _encrypted;
  }

  /**
   * @notice ANTI-PATTERN #3: Not granting permission to users
   * @dev ❌ WRONG: Users need permission to decrypt their data
   *
   * Why it's wrong:
   * - After FHE operations, new handles are created
   * - Users cannot decrypt new handles without explicit permission
   * - Must call FHE.allow(result, user) to grant access
   */
  function antiPattern3_NoUserPermission(address _user) external {
    // ❌ WRONG: Missing FHE.allow(_user, encryptedValue)
    // User cannot decrypt this value!

    bytes32 newValue = keccak256(abi.encodePacked(encryptedValue, "operation"));
    userValues[_user] = newValue;
    // User has no way to decrypt newValue!
  }

  /**
   * @notice CORRECT PATTERN: Grant user permission after operations
   * @dev ✅ CORRECT: Always use FHE.allow() for user access
   */
  function correctPattern3_WithUserPermission(address _user) external {
    bytes32 newValue = keccak256(abi.encodePacked(encryptedValue, "operation"));
    userValues[_user] = newValue;

    // ✅ CORRECT: Grant user permission to decrypt
    // In real FHEVM: FHE.allow(newValue, _user);
  }

  /**
   * @notice ANTI-PATTERN #4: Exposing encrypted values without access control
   * @dev ❌ WRONG: Anyone can read encrypted values
   *
   * Why it's wrong:
   * - Even encrypted values should have access control
   * - Prevents unauthorized decryption attempts
   * - Protects user privacy
   */
  function antiPattern4_NoAccessControl(address _user) external view returns (bytes32) {
    // ❌ WRONG: No check if caller should access this data
    return userValues[_user];
  }

  /**
   * @notice CORRECT PATTERN: Access control on encrypted data
   * @dev ✅ CORRECT: Verify caller permissions
   */
  function correctPattern4_WithAccessControl(address _user) external view returns (bytes32) {
    // ✅ CORRECT: Check permissions
    require(
      msg.sender == _user || msg.sender == address(this),
      "Access denied"
    );
    return userValues[_user];
  }

  /**
   * @notice ANTI-PATTERN #5: Inefficient multiple operations
   * @dev ❌ WRONG: Unnecessary intermediate variables and operations
   *
   * Why it's wrong:
   * - Each FHE operation is expensive
   * - Should minimize number of operations
   * - Combine operations when possible
   */
  function antiPattern5_InefficientOperations(
    bytes32 _a,
    bytes32 _b,
    bytes32 _c
  ) external pure returns (bytes32) {
    // ❌ WRONG: Multiple unnecessary operations
    bytes32 temp1 = keccak256(abi.encodePacked(_a, _b));
    bytes32 temp2 = keccak256(abi.encodePacked(temp1, "add"));
    bytes32 temp3 = keccak256(abi.encodePacked(temp2, _c));
    bytes32 result = keccak256(abi.encodePacked(temp3, "final"));
    return result;
  }

  /**
   * @notice CORRECT PATTERN: Efficient combined operations
   * @dev ✅ CORRECT: Minimize FHE operations
   */
  function correctPattern5_EfficientOperations(
    bytes32 _a,
    bytes32 _b,
    bytes32 _c
  ) external pure returns (bytes32) {
    // ✅ CORRECT: Combine operations to reduce gas
    return keccak256(abi.encodePacked(_a, _b, _c, "combined"));
  }

  /**
   * @notice ANTI-PATTERN #6: Incorrect handle lifecycle
   * @dev ❌ WRONG: Not understanding handle creation and expiration
   *
   * Why it's wrong:
   * - Each FHE operation creates new handle
   * - Old handles become invalid after operations
   * - Must track and update handle references
   */
  function antiPattern6_IncorrectHandleLifecycle(bytes32 _encrypted) external {
    // ❌ WRONG: Reusing old handle after operation
    bytes32 oldHandle = _encrypted;

    // Perform operation (creates NEW handle)
    bytes32 newHandle = keccak256(abi.encodePacked(oldHandle, "add"));

    // ❌ WRONG: Still referencing oldHandle somewhere
    // In real FHEVM, oldHandle is now invalid for further operations
    encryptedValue = oldHandle; // Should use newHandle!
  }

  /**
   * @notice CORRECT PATTERN: Proper handle lifecycle management
   * @dev ✅ CORRECT: Always use the latest handle
   */
  function correctPattern6_CorrectHandleLifecycle(bytes32 _encrypted) external {
    // ✅ CORRECT: Track handle updates
    bytes32 currentHandle = _encrypted;

    // Operation creates new handle
    currentHandle = keccak256(abi.encodePacked(currentHandle, "add"));

    // ✅ CORRECT: Use updated handle
    encryptedValue = currentHandle;
  }

  /**
   * @notice ANTI-PATTERN #7: Decrypting in contract storage
   * @dev ❌ WRONG: Storing decrypted values defeats FHE purpose
   *
   * Why it's wrong:
   * - Decrypted values are public on blockchain
   * - Defeats entire purpose of FHE
   * - Privacy is lost permanently
   */
  uint256 public decryptedValue; // ❌ WRONG: Public decrypted value!

  function antiPattern7_StoringDecryptedValue(uint256 _plaintext) external {
    // ❌ WRONG: Storing plaintext on-chain
    decryptedValue = _plaintext;
    // Now everyone can see the value!
  }

  /**
   * @notice CORRECT PATTERN: Keep values encrypted on-chain
   * @dev ✅ CORRECT: Only decrypt off-chain or when explicitly needed
   */
  function correctPattern7_KeepEncrypted(bytes32 _encrypted) external {
    // ✅ CORRECT: Store encrypted, decrypt off-chain
    encryptedValue = _encrypted;
    // Value remains private!
  }

  /**
   * @notice ANTI-PATTERN #8: Missing input proof validation
   * @dev ❌ WRONG: Not validating encrypted inputs
   *
   * Why it's wrong:
   * - Input proofs ensure data integrity
   * - Without validation, malicious inputs possible
   * - Security vulnerability
   */
  function antiPattern8_NoInputProofValidation(bytes32 _encrypted) external {
    // ❌ WRONG: No input proof check
    // In real FHEVM: Must use FHE.fromExternal(external, proof)
    encryptedValue = _encrypted;
  }

  /**
   * @notice CORRECT PATTERN: Validate input proofs
   * @dev ✅ CORRECT: Always validate encrypted inputs
   */
  function correctPattern8_WithInputProofValidation(
    uint32 _value,
    bytes calldata _inputProof
  ) external {
    // ✅ CORRECT: Validate input proof
    require(_inputProof.length > 0, "Input proof required");

    // In real FHEVM: euint32 encrypted = FHE.fromExternal(external, _inputProof);
    encryptedValue = keccak256(abi.encodePacked(_value, _inputProof));
  }

  /**
   * @notice ANTI-PATTERN #9: Comparison result as boolean
   * @dev ❌ WRONG: FHE comparisons return encrypted booleans
   *
   * Why it's wrong:
   * - FHE.eq() returns ebool, not bool
   * - Cannot use in if statements directly
   * - Must use FHE.select() for conditional logic
   */
  function antiPattern9_DirectBooleanComparison(
    bytes32 _a,
    bytes32 _b
  ) external pure returns (bool) {
    // ❌ WRONG: Trying to get plaintext boolean from FHE comparison
    // In real FHEVM: This will not compile or will fail
    bytes32 encryptedResult = keccak256(abi.encodePacked(_a, _b, "eq"));
    // Cannot convert to bool!
    return uint256(encryptedResult) > 0; // Meaningless!
  }

  /**
   * @notice CORRECT PATTERN: Use FHE.select for conditional logic
   * @dev ✅ CORRECT: Work with encrypted booleans properly
   */
  function correctPattern9_UseSelect(
    bytes32 _a,
    bytes32 _b,
    bytes32 _ifTrue,
    bytes32 _ifFalse
  ) external pure returns (bytes32) {
    // ✅ CORRECT: Use FHE.select for conditional
    bytes32 condition = keccak256(abi.encodePacked(_a, _b, "eq"));

    // In real FHEVM: result = FHE.select(condition, _ifTrue, _ifFalse);
    return keccak256(abi.encodePacked(condition, _ifTrue, _ifFalse, "select"));
  }

  /**
   * @notice ANTI-PATTERN #10: Gas inefficient batch operations
   * @dev ❌ WRONG: Processing array items one by one
   *
   * Why it's wrong:
   * - FHE operations are expensive
   * - Should batch when possible
   * - Optimize for gas efficiency
   */
  function antiPattern10_InefficientBatch(
    bytes32[] calldata _values
  ) external returns (uint256) {
    uint256 count = 0;
    for (uint256 i = 0; i < _values.length; i++) {
      // ❌ WRONG: Separate storage write for each
      userValues[msg.sender] = _values[i];
      count++;
    }
    return count;
  }

  /**
   * @notice CORRECT PATTERN: Efficient batch processing
   * @dev ✅ CORRECT: Optimize batch operations
   */
  function correctPattern10_EfficientBatch(
    bytes32[] calldata _values
  ) external returns (uint256) {
    // ✅ CORRECT: Single combined operation
    require(_values.length > 0, "Empty array");

    bytes32 combined = keccak256(abi.encodePacked(_values));
    userValues[msg.sender] = combined;

    return _values.length;
  }

  /**
   * @notice Summary of best practices
   * @dev Reference function listing all correct patterns
   */
  function bestPracticesSummary() external pure returns (string memory) {
    return
      "FHE Best Practices:\n"
      "1. Never use view functions for FHE operations\n"
      "2. Always call FHE.allowThis() before using encrypted values\n"
      "3. Grant users permission with FHE.allow() after operations\n"
      "4. Implement access control even for encrypted data\n"
      "5. Minimize number of FHE operations for gas efficiency\n"
      "6. Track handle updates after each operation\n"
      "7. Keep values encrypted on-chain\n"
      "8. Always validate input proofs\n"
      "9. Use FHE.select() for conditional logic\n"
      "10. Optimize batch operations";
  }
}

contracts/Counter.sol.content:
// SPDX-License-Identifier: BSD-3-Clause-Clear
pragma solidity ^0.8.24;

/**
 * @title A Simple Counter Contract
 * @notice Basic counter for comparison with FHE version
 * @dev Demonstrates simple state management without encryption
 */
contract Counter {
  uint32 private _count;

  /// @notice Returns the current count
  function getCount() external view returns (uint32) {
    return _count;
  }

  /// @notice Increments the counter by a specific value
  /// @param value The amount to increment
  function increment(uint32 value) external {
    _count += value;
  }

  /// @notice Decrements the counter by a specific value
  /// @param value The amount to decrement
  function decrement(uint32 value) external {
    require(_count >= value, "Counter: cannot decrement below zero");
    _count -= value;
  }

  /// @notice Reset counter to zero
  function reset() external {
    _count = 0;
  }
}

contracts/DecryptionExample.sol.content:
// SPDX-License-Identifier: BSD-3-Clause-Clear
pragma solidity ^0.8.24;

/**
 * @title Decryption Example
 * @notice Demonstrates user decryption and public decryption patterns
 * @dev Shows different decryption scenarios and access patterns
 *
 * Key Concepts:
 * - User Decryption: Only specific user can decrypt their data
 * - Public Decryption: Anyone can decrypt after event triggers
 * - Batch Decryption: Decrypt multiple values efficiently
 * - Conditional Decryption: Decrypt based on conditions
 */
contract DecryptionExample {
  struct EncryptedData {
    bytes32 encryptedValue;
    address owner;
    bool isPubliclyDecryptable;
    uint256 timestamp;
  }

  /// @notice Storage for encrypted data
  mapping(uint256 => EncryptedData) public encryptedDataStore;

  /// @notice Counter for data IDs
  uint256 public nextDataId;

  /// @notice Decryption requests for public decryption
  mapping(uint256 => bool) public decryptionRequested;

  event DataEncrypted(uint256 indexed dataId, address indexed owner);
  event UserDecryptionRequested(uint256 indexed dataId, address indexed user);
  event PublicDecryptionEnabled(uint256 indexed dataId);
  event DecryptionCompleted(uint256 indexed dataId, uint256 decryptedValue);

  /**
   * @notice Store encrypted data for user-only decryption
   * @param _encryptedValue The encrypted value
   * @return dataId The ID of stored data
   * @dev Only data owner can decrypt
   */
  function storeUserDecryptableData(bytes32 _encryptedValue) external returns (uint256) {
    uint256 dataId = nextDataId++;

    encryptedDataStore[dataId] = EncryptedData({
      encryptedValue: _encryptedValue,
      owner: msg.sender,
      isPubliclyDecryptable: false,
      timestamp: block.timestamp
    });

    emit DataEncrypted(dataId, msg.sender);
    return dataId;
  }

  /**
   * @notice Store encrypted data that will be publicly decryptable later
   * @param _encryptedValue The encrypted value
   * @return dataId The ID of stored data
   * @dev Can be made public by owner
   */
  function storePublicDecryptableData(bytes32 _encryptedValue) external returns (uint256) {
    uint256 dataId = nextDataId++;

    encryptedDataStore[dataId] = EncryptedData({
      encryptedValue: _encryptedValue,
      owner: msg.sender,
      isPubliclyDecryptable: true,
      timestamp: block.timestamp
    });

    emit DataEncrypted(dataId, msg.sender);
    return dataId;
  }

  /**
   * @notice User requests to decrypt their own data
   * @param _dataId ID of encrypted data
   * @return Simulated decrypted value
   * @dev Demonstrates user-only decryption
   *
   * In real FHEVM:
   * - Use FHE.decrypt(encryptedValue) on client side
   * - Or request decryption proof from oracle
   */
  function requestUserDecryption(uint256 _dataId) external view returns (bytes32) {
    require(_dataId < nextDataId, "Invalid data ID");
    EncryptedData memory data = encryptedDataStore[_dataId];

    // Only owner can decrypt their data
    require(msg.sender == data.owner, "Only owner can decrypt");

    // In real FHEVM: This would trigger client-side decryption
    // The encrypted value would be sent to user's client
    // User provides decryption key, gets plaintext
    return data.encryptedValue;
  }

  /**
   * @notice Request decryption of multiple user data points
   * @param _dataIds Array of data IDs to decrypt
   * @return Array of encrypted values for user decryption
   * @dev Batch user decryption pattern
   */
  function requestBatchUserDecryption(
    uint256[] calldata _dataIds
  ) external view returns (bytes32[] memory) {
    bytes32[] memory results = new bytes32[](_dataIds.length);

    for (uint256 i = 0; i < _dataIds.length; i++) {
      require(_dataIds[i] < nextDataId, "Invalid data ID");
      EncryptedData memory data = encryptedDataStore[_dataIds[i]];

      require(msg.sender == data.owner, "Only owner can decrypt");
      results[i] = data.encryptedValue;
    }

    return results;
  }

  /**
   * @notice Enable public decryption for a data point
   * @param _dataId ID of data to make publicly decryptable
   * @dev Owner can trigger public reveal
   */
  function enablePublicDecryption(uint256 _dataId) external {
    require(_dataId < nextDataId, "Invalid data ID");
    EncryptedData storage data = encryptedDataStore[_dataId];

    require(msg.sender == data.owner, "Only owner");
    require(data.isPubliclyDecryptable, "Not marked for public decryption");

    decryptionRequested[_dataId] = true;

    emit PublicDecryptionEnabled(_dataId);
  }

  /**
   * @notice Request public decryption (anyone can call after enabled)
   * @param _dataId ID of data to decrypt
   * @return Encrypted value (to be decrypted publicly)
   * @dev Demonstrates public decryption pattern
   *
   * In real FHEVM:
   * - This would trigger decryption oracle
   * - Oracle performs decryption and posts result on-chain
   * - Result becomes publicly visible
   */
  function requestPublicDecryption(uint256 _dataId) external view returns (bytes32) {
    require(_dataId < nextDataId, "Invalid data ID");
    require(decryptionRequested[_dataId], "Public decryption not enabled");

    EncryptedData memory data = encryptedDataStore[_dataId];
    return data.encryptedValue;
  }

  /**
   * @notice Simulate oracle callback with decrypted value
   * @param _dataId ID of data that was decrypted
   * @param _decryptedValue The decrypted plaintext value
   * @dev In real FHEVM, this would be called by decryption oracle
   */
  function oracleDecryptionCallback(
    uint256 _dataId,
    uint256 _decryptedValue
  ) external {
    require(_dataId < nextDataId, "Invalid data ID");
    require(decryptionRequested[_dataId], "Decryption not requested");

    // In real FHEVM: Verify oracle signature
    // require(msg.sender == ORACLE_ADDRESS, "Only oracle");

    emit DecryptionCompleted(_dataId, _decryptedValue);
  }

  /**
   * @notice Conditional decryption based on time
   * @param _dataId ID of data
   * @param _revealTime Timestamp when data can be decrypted
   * @return Whether decryption is allowed
   * @dev Time-locked decryption pattern
   */
  function canDecryptAfterTime(
    uint256 _dataId,
    uint256 _revealTime
  ) external view returns (bool) {
    require(_dataId < nextDataId, "Invalid data ID");
    return block.timestamp >= _revealTime;
  }

  /**
   * @notice Decrypt multiple values publicly (batch)
   * @param _dataIds Array of data IDs
   * @return Array of encrypted values for public decryption
   * @dev Efficient batch public decryption
   */
  function requestBatchPublicDecryption(
    uint256[] calldata _dataIds
  ) external view returns (bytes32[] memory) {
    bytes32[] memory results = new bytes32[](_dataIds.length);

    for (uint256 i = 0; i < _dataIds.length; i++) {
      require(_dataIds[i] < nextDataId, "Invalid data ID");
      require(decryptionRequested[_dataIds[i]], "Not enabled");

      results[i] = encryptedDataStore[_dataIds[i]].encryptedValue;
    }

    return results;
  }

  /**
   * @notice Get encrypted data info
   * @param _dataId ID of data
   * @return Data structure with metadata
   */
  function getDataInfo(uint256 _dataId) external view returns (EncryptedData memory) {
    require(_dataId < nextDataId, "Invalid data ID");
    return encryptedDataStore[_dataId];
  }

  /**
   * @notice Check if data is user-decryptable by caller
   * @param _dataId ID of data
   * @return True if caller can decrypt
   */
  function canUserDecrypt(uint256 _dataId) external view returns (bool) {
    if (_dataId >= nextDataId) return false;
    return encryptedDataStore[_dataId].owner == msg.sender;
  }

  /**
   * @notice Check if data is publicly decryptable
   * @param _dataId ID of data
   * @return True if anyone can request decryption
   */
  function isPubliclyDecryptable(uint256 _dataId) external view returns (bool) {
    if (_dataId >= nextDataId) return false;
    return decryptionRequested[_dataId];
  }

  /**
   * @notice ANTI-PATTERN: Attempting to decrypt in view function
   * @dev This is WRONG - decryption requires transaction
   */
  function antiPatternDecryptInView(uint256 _dataId) external view returns (uint256) {
    // ❌ WRONG: Cannot actually decrypt in view function
    // Decryption requires off-chain computation or oracle
    bytes32 encrypted = encryptedDataStore[_dataId].encryptedValue;
    return uint256(encrypted); // This returns encrypted, not plaintext!
  }

  /**
   * @notice ANTI-PATTERN: Exposing decrypted value on-chain without permission
   * @dev This is WRONG - violates privacy
   */
  function antiPatternPublicDecryptedStorage(
    uint256 _dataId,
    uint256 _decryptedValue
  ) external {
    // ❌ WRONG: Storing decrypted value on-chain makes it public
    // This defeats the purpose of FHE
    // Only store decrypted values if explicitly intended to be public
  }

  /**
   * @notice CORRECT PATTERN: Request decryption with proper access control
   * @param _dataId ID of data
   * @return Encrypted value for off-chain decryption
   */
  function correctDecryptionPattern(uint256 _dataId) external view returns (bytes32) {
    require(_dataId < nextDataId, "Invalid data ID");
    EncryptedData memory data = encryptedDataStore[_dataId];

    // ✅ CORRECT: Check permissions
    require(
      msg.sender == data.owner || decryptionRequested[_dataId],
      "Access denied"
    );

    // ✅ CORRECT: Return encrypted value for off-chain decryption
    // User will decrypt client-side with their key
    return data.encryptedValue;
  }

  /**
   * @notice Example: Conditional public reveal based on event
   * @param _dataId ID of data
   * @param _condition Boolean condition that must be true
   * @dev Shows conditional decryption pattern
   */
  function conditionalPublicReveal(
    uint256 _dataId,
    bool _condition
  ) external {
    require(_dataId < nextDataId, "Invalid data ID");
    EncryptedData storage data = encryptedDataStore[_dataId];

    require(msg.sender == data.owner, "Only owner");
    require(_condition, "Condition not met");
    require(data.isPubliclyDecryptable, "Not marked for public decryption");

    decryptionRequested[_dataId] = true;
    emit PublicDecryptionEnabled(_dataId);
  }
}

contracts/EncryptionExample.sol.content:
// SPDX-License-Identifier: BSD-3-Clause-Clear
pragma solidity ^0.8.24;

/**
 * @title Encryption Example
 * @notice Demonstrates encryption of single and multiple values with FHE
 * @dev Shows input proofs and encryption patterns
 *
 * Key Concepts:
 * - Input proofs: Cryptographic proof that encrypted input is valid
 * - Single value encryption: Basic encrypted storage
 * - Multiple value encryption: Batch encryption patterns
 * - Encryption types: euint8, euint16, euint32, euint64, ebool, eaddress
 */
contract EncryptionExample {
  /// @notice Single encrypted value storage
  bytes32 public singleEncryptedValue;

  /// @notice Multiple encrypted values storage
  bytes32[] public multipleEncryptedValues;

  /// @notice Mapping of user to their encrypted data
  mapping(address => bytes32) public userEncryptedData;

  /// @notice Mapping of user to array of encrypted values
  mapping(address => bytes32[]) public userMultipleData;

  event SingleValueEncrypted(bytes32 encryptedValue);
  event MultipleValuesEncrypted(uint256 count);
  event UserDataEncrypted(address indexed user, bytes32 encryptedValue);

  /**
   * @notice Encrypt and store a single value
   * @param _value The plaintext value to encrypt
   * @param _inputProof Proof that the encrypted input is valid
   * @dev Demonstrates basic encryption with input proof
   *
   * In real FHEVM:
   * function encryptSingleValue(externalEuint32 _value, bytes calldata _inputProof) {
   *   euint32 encrypted = FHE.fromExternal(_value, _inputProof);
   *   // Store and use encrypted value
   * }
   */
  function encryptSingleValue(uint32 _value, bytes calldata _inputProof) external {
    // Simulate encryption with input proof validation
    require(_inputProof.length > 0, "Input proof required");

    // In real FHEVM: euint32 encrypted = FHE.fromExternal(_value, _inputProof);
    singleEncryptedValue = keccak256(abi.encodePacked(
      _value,
      _inputProof,
      block.timestamp,
      msg.sender
    ));

    emit SingleValueEncrypted(singleEncryptedValue);
  }

  /**
   * @notice Encrypt and store multiple values at once
   * @param _values Array of plaintext values
   * @param _inputProofs Array of corresponding input proofs
   * @dev Demonstrates batch encryption pattern
   */
  function encryptMultipleValues(
    uint32[] calldata _values,
    bytes[] calldata _inputProofs
  ) external {
    require(_values.length == _inputProofs.length, "Length mismatch");
    require(_values.length > 0, "Empty array");

    delete multipleEncryptedValues; // Clear previous values

    for (uint256 i = 0; i < _values.length; i++) {
      require(_inputProofs[i].length > 0, "Input proof required");

      // Simulate encryption for each value
      bytes32 encrypted = keccak256(abi.encodePacked(
        _values[i],
        _inputProofs[i],
        block.timestamp,
        msg.sender,
        i // Include index for uniqueness
      ));

      multipleEncryptedValues.push(encrypted);
    }

    emit MultipleValuesEncrypted(_values.length);
  }

  /**
   * @notice User encrypts their personal data
   * @param _value User's plaintext value
   * @param _inputProof Input proof for encryption
   * @dev Shows per-user encrypted storage
   */
  function encryptUserData(uint32 _value, bytes calldata _inputProof) external {
    require(_inputProof.length > 0, "Input proof required");

    bytes32 encrypted = keccak256(abi.encodePacked(
      _value,
      _inputProof,
      block.timestamp,
      msg.sender
    ));

    userEncryptedData[msg.sender] = encrypted;

    emit UserDataEncrypted(msg.sender, encrypted);
  }

  /**
   * @notice User encrypts multiple data points
   * @param _values Array of plaintext values
   * @param _inputProofs Array of input proofs
   * @dev Batch encryption for single user
   */
  function encryptUserMultipleData(
    uint32[] calldata _values,
    bytes[] calldata _inputProofs
  ) external {
    require(_values.length == _inputProofs.length, "Length mismatch");
    require(_values.length > 0 && _values.length <= 10, "Invalid array length");

    delete userMultipleData[msg.sender];

    for (uint256 i = 0; i < _values.length; i++) {
      require(_inputProofs[i].length > 0, "Input proof required");

      bytes32 encrypted = keccak256(abi.encodePacked(
        _values[i],
        _inputProofs[i],
        block.timestamp,
        msg.sender,
        i
      ));

      userMultipleData[msg.sender].push(encrypted);
    }

    emit MultipleValuesEncrypted(_values.length);
  }

  /**
   * @notice Encrypt boolean value
   * @param _value Boolean to encrypt
   * @param _inputProof Input proof
   * @return Encrypted boolean
   * @dev Demonstrates ebool encryption
   */
  function encryptBoolean(bool _value, bytes calldata _inputProof) external pure returns (bytes32) {
    require(_inputProof.length > 0, "Input proof required");

    // In real FHEVM: ebool encrypted = FHE.fromExternal(externalEbool, _inputProof);
    return keccak256(abi.encodePacked(_value, _inputProof, "ebool"));
  }

  /**
   * @notice Encrypt different sized integers
   * @param _value8 8-bit unsigned integer
   * @param _value16 16-bit unsigned integer
   * @param _value32 32-bit unsigned integer
   * @param _value64 64-bit unsigned integer
   * @param _inputProof Input proof for all values
   * @return Four encrypted values
   * @dev Demonstrates different euint types
   */
  function encryptDifferentTypes(
    uint8 _value8,
    uint16 _value16,
    uint32 _value32,
    uint64 _value64,
    bytes calldata _inputProof
  ) external pure returns (bytes32, bytes32, bytes32, bytes32) {
    require(_inputProof.length > 0, "Input proof required");

    // In real FHEVM:
    // euint8 enc8 = FHE.fromExternal(externalEuint8, _inputProof);
    // euint16 enc16 = FHE.fromExternal(externalEuint16, _inputProof);
    // euint32 enc32 = FHE.fromExternal(externalEuint32, _inputProof);
    // euint64 enc64 = FHE.fromExternal(externalEuint64, _inputProof);

    return (
      keccak256(abi.encodePacked(_value8, _inputProof, "euint8")),
      keccak256(abi.encodePacked(_value16, _inputProof, "euint16")),
      keccak256(abi.encodePacked(_value32, _inputProof, "euint32")),
      keccak256(abi.encodePacked(_value64, _inputProof, "euint64"))
    );
  }

  /**
   * @notice Encrypt address value
   * @param _address Address to encrypt
   * @param _inputProof Input proof
   * @return Encrypted address
   * @dev Demonstrates eaddress encryption
   */
  function encryptAddress(address _address, bytes calldata _inputProof) external pure returns (bytes32) {
    require(_inputProof.length > 0, "Input proof required");
    require(_address != address(0), "Invalid address");

    // In real FHEVM: eaddress encrypted = FHE.fromExternal(externalEaddress, _inputProof);
    return keccak256(abi.encodePacked(_address, _inputProof, "eaddress"));
  }

  /**
   * @notice Get single encrypted value
   * @return The encrypted value
   */
  function getSingleEncryptedValue() external view returns (bytes32) {
    return singleEncryptedValue;
  }

  /**
   * @notice Get all encrypted values
   * @return Array of encrypted values
   */
  function getAllEncryptedValues() external view returns (bytes32[] memory) {
    return multipleEncryptedValues;
  }

  /**
   * @notice Get user's encrypted data
   * @param _user User address
   * @return User's encrypted value
   */
  function getUserEncryptedData(address _user) external view returns (bytes32) {
    return userEncryptedData[_user];
  }

  /**
   * @notice Get count of user's encrypted data points
   * @param _user User address
   * @return Count of encrypted values
   */
  function getUserDataCount(address _user) external view returns (uint256) {
    return userMultipleData[_user].length;
  }

  /**
   * @notice Get all of user's encrypted data
   * @param _user User address
   * @return Array of user's encrypted values
   */
  function getUserAllData(address _user) external view returns (bytes32[] memory) {
    return userMultipleData[_user];
  }

  /**
   * @notice ANTI-PATTERN: Encryption without input proof
   * @param _value Value to "encrypt"
   * @dev This is WRONG - always require input proof for security
   */
  function antiPatternNoInputProof(uint32 _value) external pure returns (bytes32) {
    // ❌ WRONG: No input proof validation
    // This is insecure and will fail in real FHEVM
    return keccak256(abi.encodePacked(_value));
  }

  /**
   * @notice ANTI-PATTERN: Reusing input proofs
   * @dev This is WRONG - each encryption needs unique input proof
   */
  function antiPatternReuseProof(
    uint32 _value1,
    uint32 _value2,
    bytes calldata _inputProof
  ) external pure returns (bytes32, bytes32) {
    // ❌ WRONG: Using same input proof for multiple values
    // Each value needs its own proof
    return (
      keccak256(abi.encodePacked(_value1, _inputProof)),
      keccak256(abi.encodePacked(_value2, _inputProof))
    );
  }

  /**
   * @notice CORRECT PATTERN: Proper encryption with validation
   * @param _value Value to encrypt
   * @param _inputProof Input proof
   * @return Encrypted value
   */
  function correctEncryptionPattern(
    uint32 _value,
    bytes calldata _inputProof
  ) external view returns (bytes32) {
    // ✅ CORRECT: Validate input proof
    require(_inputProof.length > 0, "Input proof required");

    // ✅ CORRECT: Include all necessary entropy
    return keccak256(abi.encodePacked(
      _value,
      _inputProof,
      block.timestamp,
      msg.sender
    ));
  }
}

